import { useState } from 'react';

const Example = () => {
  const inputFact = () => ({
    key: Math.floor(Math.random() * 1e3),
    value: <input />,
  });
  const [inputs, setInputs] = useState([inputFact(), inputFact()]);
  return (
    <>
      <div>
        <strong>key</strong>
        {inputs.map(input => {
          <li>
            {input.key}: {input.value}
          </li>;
        })}
      </div>
      <div>
        <strong>index</strong>
      </div>
    </>
  );
};

export default Example;
